	2011年5月9日，世界顶级品牌沟通服务集团WPP旗下权威调研公司华通明略发布第六届年度“BrandZ 全球最具价值品牌100强 (BrandZ Top 100 Most Valuable Global Brands)”排行榜。其中，中国最大搜索引擎百度品牌价值排名全球第29位，与Facebook共同成为全球价值增长最快的品牌，并在科技类细分榜单中，成为跻身全球科技品牌10强的唯一中国公司。
</p>
<p>
	据悉，“BrandZ 全球最具价值品牌100强”研究根据财务数据，结合品牌资产的消费者指标，分析得出品牌价值，并以此评出全球最具价值100个品牌。目前，该榜单已成为国际公认的最权威的品牌排行榜之一。在今年的百强榜中，百度由2010年的第75位跃升至第29位，品牌价值增长达141%，仅次于今年刚上榜排名第35位的Facebook，后者的品牌价值增长为246%。
</p>
<p>
	2011年BrandZ报告指出，“随着中国13亿公民中越来越多的人开始使用互联网搜索，他们更多地倾向于使用百度。因为他们相信，百度能够更深入地理解中国的多元文化和语言中的细微差别。”
</p>
<p>
	事实上，以“让人们最便捷地获取信息，找到所求”为使命的百度一直致力于为用户提供最优质的搜索体验。除了不断致力于技术、产品及服务创新，为网民提供了60余款与搜索相关的产品和服务外，加强在移动、SNS等新兴领域的战略部署外，百度CEO李彦宏还在2009年，创造性地提出了“框计算”理念，并相继推出数据及应用两大开放平台，推动更多优质的数据及应用资源与网民的需求直接对接，以实现“即搜即得”、“即搜即用”。目前，框计算已经影响了 63%以上的搜索结果，深受网民好评。而优质的用户体验，也使得百度以市场份额80%左右的绝对优势，持续领跑中国搜索引擎市场。
</p>
<p>
	更值得关注的是，通过框计算及百度开放平台，百度为众多创业者和开发者提供了广阔的创业及创新平台，并帮助其从创新中受益和发展，百度对于互联网产业链发展及创新的影响力也正在逐渐释放。
</p>
<p>
	百度品牌的快速增长，也得益于其在公益领域的突出贡献。自成立来，百度就一直致力于充分利用自己的互联网及技术优势，在教育、环保、扶贫、赈灾等领域践行着自己弥合信息鸿沟、共享知识社会的企业公民理想，广受业界好评。从帮助湖北秭归农民利用网络推广滞销脐橙,到捐资1500多万元、用于汶川及玉树等震区进行应急救灾和灾区重建工作；从打击互联网不良信息、净化产业环境的“阳光行动”，到帮助盲人创业者打造“掌上盲道”网络平台，让数以万计的盲人用户可以通过手机来发短信、上网；从成立百度公益基金会、用更加专业的管理专注于救灾、教育、环保等公益项目，到推出全国首个互联网公益开放平台、为全国公益组织提供免费推广，百度在积极践行公益事业、回馈社会的同时，也正使得公益的门槛不断降低，推动着互联网时代全民公益理想的实现。
</p>
<p>
	分析人士认为，作为中国技术创新企业的杰出代表，百度公司成为全球成长最快的品牌之一并跻身全球科技品牌10强，体现了中国高科技企业蓬勃的生命力和巨大的发展潜力，也将激励更多中国品牌、尤其是中国科技品牌在世界的崛起。
